import "./Projects.css"

export default function Projects() {
    return (
        <div className="page-content">
            <div className="project-content">
                <div className="project-card">
                    <h2>Project Name</h2>
                    <img src="https://i.imgur.com/gv5OuvJ.png" alt="project 1 screenshot" />
                </div>
            </div>
        </div>
    )
}
